import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';
import Home from './components/Home';
import About from './components/About';
import Portfolio from './components/Portfolio';
import Contact from './components/Contact';
import Resume from './components/Resume';

const App = () => {
  return (
    <Router>
      <Navbar bg="light" variant="light">
        <Navbar.Brand href="/">Developer's Name</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link as={Link} to="/">Home</Nav.Link>
          <Nav.Link as={Link} to="/about">About Me</Nav.Link>
          <Nav.Link as={Link} to="/portfolio">Portfolio</Nav.Link>
          <Nav.Link as={Link} to="/contact">Contact</Nav.Link>
          <Nav.Link as={Link} to="/resume">Resume</Nav.Link>
        </Nav>
      </Navbar>

      <Container style={{ minHeight: 'calc(100vh - 56px)' }}>
        <Route path="/" exact component={Home} />
        <Route path="/about" component={About} />
        <Route path="/portfolio" component={Portfolio} />
        <Route path="/contact" component={Contact} />
        <Route path="/resume" component={Resume} />
      </Container>

      <footer style={{ backgroundColor: '#f8f9fa', textAlign: 'center', padding: '10px' }}>
        <a href="https://github.com/yourGithubUsername" target="_blank" rel="noopener noreferrer">GitHub</a> | 
        <a href="https://linkedin.com/in/yourLinkedInUsername" target="_blank" rel="noopener noreferrer">LinkedIn</a> | 
        <a href="https://stackoverflow.com/users/yourStackOverflowId" target="_blank" rel="noopener noreferrer">StackOverflow</a>
      </footer>
    </Router>
  );
};

export default App;
